import logo from "./images/netflix-Logo.svg";
import React from "react";
import HeaderCss from "./header.module.css";

function Header() {
  return (
    <>
      <div className={HeaderCss.container1 }>
        <nav>
          <img className={HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
          <button className={HeaderCss.btn}>Sign In</button>
        </nav>
        <p className = {HeaderCss.main_heading}>Unlimited movies, TV shows, and more</p>
        <p className = {HeaderCss.sub_heading}>Watch anywhere. Cancel anytime.</p>
        <p className = {HeaderCss.sub_heading}>Ready to watch? Enter your email to create or restart your membership.</p>
        <input type = "text">Email address</input><button>Get Started &gt;</button>
      </div>
    </>
  );
}

export default Header;
